INSERT INTO `sys_role` VALUES ('2', '管理员', '系统管理员，负责系统用户及用户组管理，拥有其他用户的所有权限。可以查看所有数据。', '1', '2017-06-10 14:18:49');
INSERT INTO `sys_role` VALUES ('3', '咨询师', '乐语客服，负责接受学员的在线咨询，收集有意向报名学员的基本数据，包括姓名、电话、意向科目。 可在系统中添加学员，可以查看自己添加的学员数据，并编辑学员信息，联系计划，咨询记录等。', '1', '2017-06-10 14:19:20');
INSERT INTO `sys_role` VALUES ('4', '项目经理', '负责项目管理，每个项目经理可能负责多个项目，如平面设计项目、室内设计项目等。 可以查看意向报名自己项目的所有学员，管理项目成员的数据分配和统计。', '1', '2017-06-10 14:19:54');
INSERT INTO `sys_role` VALUES ('5', '电销组长', '负责小组管理，组内的成员可能会涉及多个项目。组长本身也可以成交数据，等同于电销人员。 可以查看组内成员分配到的所有学员数据。 可查看组内成员的数据汇总，包括计划数、分配数、成交数。', '1', '2017-06-10 14:20:20');
INSERT INTO `sys_role` VALUES ('6', '电销人员', '负责通过电话或者其他方式联系学员，跟进引导分配到的学员进行报名。 可在系统中编辑学员详细信息，添加联系记录，记录联系结果。', '1', '2017-06-10 14:20:52');
