INSERT INTO `tb_position` VALUES ('1', 'PHP开发工程师', '1', '大专', '6', '3', '1、根据系统总体设计完成系统的设计与开发工作；\n2、完成模块代码编写、单元测试、代码维护工作；\n3、编写技术相关文档，熟练使用迭代开发方法进行系统开发；\n4、日常技术支持以及网站维护。', '1、计算机相关专业，2-3年PHP相关工作经验，学历接受新技术能力强，熟练编写代码，模块化程序开发，掌握前段页面开发的相关技术；\n2、熟练常用PHP开发框架，例如YII、ThinkPHP等，并有至少一种开发经验；\n3、拥有规范的代码编写风格，要求结构清晰，命名规范，逻辑性强，熟悉HTML、CSS、JS、jQuery框架等相关前段技术；\n4、熟悉Mysql数据库及NoSQL技术，有独立设计数据库的能力，能独立设计中小型项目，能按需求开发相应的新功能；\n5、熟悉Linux操作系统服务器常用指令更佳；\n6、具有良好的学习能力，时间和流程意识强，有较好的沟通交流能力及团队合作意识，责任心强，有积极主动的工作态度，能够迅速融入团队。', '020-12345678', '广州', '1', '2018-05-21 09:23:57', '2018-05-27 00:48:56', '1', '1', '0', '1');
INSERT INTO `tb_position` VALUES ('2', 'Java开发工程师', '1', '本科', '10', '3', '1、根据系统总体设计完成系统的设计与开发工作；\n2、完成模块代码编写、单元测试、代码维护工作；\n3、编写技术相关文档，熟练使用迭代开发方法进行系统开发；\n4、日常技术支持以及网站维护。', '1、计算机相关专业，2-3年PHP相关工作经验，学历接受新技术能力强，熟练编写代码，模块化程序开发，掌握前段页面开发的相关技术；\n2、熟练常用PHP开发框架，例如YII、ThinkPHP等，并有至少一种开发经验；\n3、拥有规范的代码编写风格，要求结构清晰，命名规范，逻辑性强，熟悉HTML、CSS、JS、jQuery框架等相关前段技术；\n4、熟悉Mysql数据库及NoSQL技术，有独立设计数据库的能力，能独立设计中小型项目，能按需求开发相应的新功能；\n5、熟悉Linux操作系统服务器常用指令更佳；\n6、具有良好的学习能力，时间和流程意识强，有较好的沟通交流能力及团队合作意识，责任心强，有积极主动的工作态度，能够迅速融入团队。', '020-12345678', '广州', '1', '2018-05-21 09:23:57', '2018-05-27 14:10:21', '1', '1', '0', '1');
