-- ----------------------------
-- Procedure structure for createChildLst
-- ----------------------------
DROP PROCEDURE IF EXISTS `createChildLst`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `createChildLst`(IN rootId BIGINT,IN nDepth INT)
BEGIN
 DECLARE done INT DEFAULT 0;
 DECLARE b INT;
 DECLARE cur1 CURSOR FOR SELECT id FROM sys_department where parent_id=rootId;
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;


 OPEN cur1;

 FETCH cur1 INTO b;
 WHILE done=0 DO
         CALL createChildLst(b,nDepth+1);
         FETCH cur1 INTO b;
 END WHILE;

 CLOSE cur1;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for showChildLst
-- ----------------------------
DROP PROCEDURE IF EXISTS `showChildLst`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `showChildLst`(IN rootId BIGINT)
BEGIN
 CREATE TEMPORARY TABLE IF NOT EXISTS tmpLst 
  (sno bigint primary key auto_increment,id int,depth int);
 DELETE FROM tmpLst;
    
 CALL createChildLst(rootId,0);
    
 select tmpLst.*,sys_department.* from tmpLst,sys_department where tmpLst.id=sys_department.id order by tmpLst.sno;
END
;;
DELIMITER ;
